const Header = () => {
  return (
    <div className="bg-white shadow p-8">
        <div className="">
            <h1 className="text-3xl font-bold">EzCOde<span className="text-orange-400">Academy</span></h1>
        </div>
      <div className="">
        <ul className="flex flex-wrap items-center justify-center gap-5">
          <li>Home</li>
          <li>Courses</li>
          <li>Pages</li>
          <li>Gallery</li>
          <li>Contact us</li>
        </ul>
        <div className="flex justify-end gap-5">
        <ol>
          <li>Login</li>
        </ol>
        <button className="border bg-orange-400 rounded-lg ">Register Now</button>
      </div>
      </div>
     
    </div>
  );
};

export default Header;
